import React from 'react';
import * as S from './styled';
import {createTheme, ThemeProvider} from "@material-ui/core";

const theme = createTheme({
    pallete: {
        primary: 'white',
        secondary: 'red',
    }
})


const Header = () => {
    return(
        <header>
            <S.Wrapper>
                <S.Input type="text"/>
                <ThemeProvider theme={theme}>
                    <S.sButton variant="contained" color='secondary'>Search</S.sButton>
                </ThemeProvider>
            </S.Wrapper>

        </header>
    );
};

export default Header;
